            <Link href="/about"><a title="About page">Goto About</a></Link>
            <p>Hello Next.js!</p>
            <Link href="/[slug]"><a>To post</a></Link>
        </Layout>
        <Toast>
      This site is
      <strong>Server Side Rendered</strong>
    </Toast>
      </div>
    );
}
